import React, { Component } from 'react'
import logo from './assets/icons/next_primary.svg'


export class NavBar extends Component {
    state = {
        animation: 'overlay',
        direction: 'right',
        dimmed: true,
        visible: false,
    }

    constructor(props) {
        super(props);
        this.childLook = React.createRef();
        this.state = {
            isLoading: false,
            signButton: <></>,
            value: ''
        }
    }

    render() {

        return (

            <div>
                <header className="header-area header-sticky">
                    <div className="row">
                        <div className="col-12">
                            <nav className="main-nav">
                                <div className="">
                                    <a href="/#" className="logo" style={{ color: 'black', paddingLeft:'30px',paddingTop: '7px'}}>
                                        <h2 style={{ color: 'rgb(10, 10, 10)',fontFamily:'Ubuntu',  marginTop:'0px',fontSize: '24px', fontWeight: '600',letterSpacing: -1.5 }}><img className="" style={{ width: '16pt', height: 'auto', marginBottom:5 }} src={logo}></img> Clearweb</h2>
                                    </a>
                                    <div style={{float:'right', paddingTop: '10px'}}>
                                    <a href="/#portfolio" className="logo" style={{ color: '#fff', paddingRight:'30px' }}>
                                        <h2 style={{ color: 'rgb(10, 10, 10)',fontFamily:'Cabin',  marginTop:'0px',fontSize: '18px', fontWeight: '400',letterSpacing: -0.5 }}>Features</h2>
                                    </a>

                                    {/*<a href="/#services" className="logo" style={{ color: 'black', paddingRight:'30px' }}>
                                        <h2 style={{ color: 'rgb(10, 10, 10)',fontFamily:'Ubuntu',  marginTop:'0px',fontSize: '18px', fontWeight: '600',letterSpacing: -0.5 }}>SERVICES</h2>
                                    </a>*/}
                                    </div>

                                </div>
                            </nav>
                        </div>
                    </div>
                </header>
            </div>
        )
    }
}

export default NavBar
